    <style>
        body {

            color: #58646A;
            background: #F6F6F6;
        }

        a:link {
            color: #2469a0;
        }

        a:visited {
            color: #1b4e76;
        }

        a:hover, a:active {

            font-size: 14px;
            line-height: 1.33;
            border-radius: 5px;
            border: none;
            text-align: center;
            white-space: nowrap;
            vertical-align: middle;
            text-decoration: none;
        }

        .btn-primary {
            color: #FFF;
            background-color: #2D9CDB;
            border-color: none;
        }

        a.btn-primary:link, a.btn-primary:visited {
            color: #FBFBFB;
        }

        a.btn-primary:hover, a.btn-primary:active {
            background-color: #2685BC;
            cursor: pointer;
        }

        .footer {
            text-align: center;
            font-size: 12px;
            margin-top: 20px;
        }

        @media screen and (max-width: 600px) {
            img {
                height: auto !important;
            }
        }

        @media screen and (max-width: 512px) {
            body {
                font-size: 14px;
            }

            .container {
                padding: 20px 15px 35px 15px;
                margin: 0 10px;
            }
        }

        @media screen and (max-width: 320px) {
            body {
                font-size: 12px;
            }
        }
    </style>
